import react from "react";
import "./header.css";
const Header = () => {
  return (
    <header className="header">
        <div className=""></div>
      <div className="logo">
        <img src="/images/Logo-header.svg" alt="Logo" />
      </div>
    </header>
  );
};

export default Header;
